import React from 'react';

export default function TrafficMap() {
   return (
      <iframe
         style={iframeStyle}
         width="600"
         height="450"
         loading='lazy'
         allow="fullscreen"
         referrerPolicy="no-referrer-when-downgrade"
         src={`https://www.google.com/maps/embed/v1/directions?key=${process.env.REACT_APP_GOOGLE_MAPS_EMBED_API_KEY}
    &origin=${userLocation.lat},${userLocation.long}&destination=Truckee,CA`}></iframe>
   )
}
